import React from 'react';
import {makeStyles,Avatar,ListItem,List,ListItemText,ListItemAvatar,Typography} from '@material-ui/core';
import * as Constants from '../theme';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    title: {
        color: Constants.TITLE_COLOR,
    }
}));

function Experience() {
    const classes = useStyles();
    return (
        <div>
            <h2>Experience</h2>
            <List className={classes.root}>
                <ListItem alignItems="flex-start">
                    <ListItemAvatar>
                    <Avatar alt="UCLA" src="https://brand.ucla.edu/images/identity/logos-and-marks/script-logo.jpg" />
                    </ListItemAvatar>
                    <ListItemText
                    primary="Brunch this weekend?"
                    secondary={
                        <List>
                            <ListItem>Single-line item</ListItem>
                            <ListItem>Single-line item</ListItem>
                            <ListItem>Single-line item</ListItem>
                        </List>
                    }
                    />
                </ListItem>
                <ListItem alignItems="flex-start">
                    <ListItemAvatar>
                    <Avatar alt="UCLA" src="https://pbs.twimg.com/profile_images/1017178471213068289/gxAdnKeD_400x400.jpg" />
                    </ListItemAvatar>
                    <ListItemText
                    primary="Brunch this weekend?"
                    secondary={
                        <List>
                            <ListItem>Single-line item</ListItem>
                            <ListItem>Single-line item</ListItem>
                            <ListItem>Single-line item</ListItem>
                        </List>
                    }
                    />
                </ListItem>
            </List>
        </div>
    );
  }

  export default Experience;
